BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Battles_Guilds" (
	"battleId"	INTEGER,
	"name"	TEXT,
	"id"	TEXT,
	"alliance"	TEXT,
	"allianceId"	TEXT,
	"kills"	INTEGER,
	"deaths"	INTEGER,
	"killFame"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Battles" (
	"battle_id"	INTEGER,
	"time"	TEXT,
	"playerCount"	INTEGER DEFAULT 0,
	"isWinnerG"	INTEGER,
	"winner"	TEXT,
	"winnerId"	TEXT,
	"winnerCount"	INTEGER DEFAULT 0,
	"winnerKills"	INTEGER DEFAULT 0,
	"winnerDeaths"	INTEGER DEFAULT 0,
	"winnerFame"	INTEGER DEFAULT 0,
	"isLoserG"	INTEGER,
	"loser"	TEXT,
	"loserId"	TEXT,
	"loserCount"	INTEGER DEFAULT 0,
	"loserKills"	INTEGER DEFAULT 0,
	"loserDeaths"	INTEGER DEFAULT 0,
	"loserFame"	INTEGER DEFAULT 0,
	"totalKills"	INTEGER DEFAULT 0,
	"totalFame"	INTEGER DEFAULT 0
);
CREATE TABLE IF NOT EXISTS "Battles_Players" (
	"battle_id"	INTEGER,
	"name"	TEXT,
	"id"	TEXT,
	"alliance"	TEXT,
	"allianceId"	TEXT,
	"guild"	TEXT,
	"guildId"	TEXT,
	"kills"	INTEGER,
	"deaths"	INTEGER,
	"killFame"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Events_Victims_Inventory" (
	"event_id"	TEXT,
	"type"	TEXT,
	"count"	INTEGER,
	"quality"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Events_Victims" (
	"event_id"	INTEGER,
	"name"	TEXT,
	"id"	TEXT,
	"guild"	TEXT,
	"guildId"	TEXT,
	"alliance"	TEXT,
	"allianceId"	TEXT,
	"avatar"	TEXT,
	"avatarRing"	TEXT,
	"deathFame"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Events" (
	"event_id"	INTEGER,
	"timeStamp"	TEXT,
	"victimKillFame"	INTEGER,
	"battle_id"	INTEGER
);
CREATE TABLE IF NOT EXISTS "Battles_Alliances" (
	"battle_id"	INTEGER,
	"name"	TEXT,
	"id"	TEXT,
	"kills"	INTEGER,
	"deaths"	INTEGER,
	"killFame"	INTEGER
);
COMMIT;
